                    />
                  </td>
                  <td style={style}>
                    <img
                      src="/images/tick.png"
                      alt=""
                      style={{ width: "30px" }}
                    />
                  </td>
                </tr>

                <tr>
                  <td style={style}>
                    Distribution of promotional material in Delegate Kit{" "}
                  </td>
                  <td style={style}>
                    <img
                      src="/images/tick.png"
                      alt=""
                      style={{ width: "30px" }}
                    />
                  </td>
                  <td style={style}>
                    <img
                      src="/images/tick.png"
                      alt=""
